var NoLogin=function(){
	this.origin=window.location.origin;
	var div=document.createElement('div');
	div.id="div-login";
	div.style.height="100%";
	div.style.width="100%";
	div.style.background="rgba(0,0,0,0.5)";
	div.style.top="0px";
	div.style.left="0px";
	div.style.position="fixed";
	div.innerHTML='<style>#q{width:500px;height:500px;margin:50px auto;background#fff;padding30px;}</style><div id="q"></div>';
	$('body').append($(div));
	var qrcode = new QRCode(document.getElementById("q"), {
		width : 500,
		height : 500
	});
	var sessionId=this.sessionId();
	qrcode.makeCode(sessionId);
	var socket = io.connect('http://pecule.in:3000',{
		query:"sessionId="+sessionId
	});

	socket.on('userDetails', function(msg){
		$("#div-login").remove();
		$("#table").show();
		$("#sp-name").html(msg.name);
		$("#sp-email").html(msg.email);
		$("#sp-phone").html(msg.phone);
		$("#sp-age").html(msg.age);
    });
}

NoLogin.prototype.sessionId=function() {
  function s4() {
    return Math.floor((1 + Math.random()) * 0x10000)
      .toString(16)
      .substring(1);
  }
  return this.origin+"/"+s4() + s4() + '-' + s4() + '-' + s4() + '-' +
    s4() + '-' + s4() + s4() + s4();
}